script: |
  super -f text -I q176.spq | sort > q176.out

inputs:
  - name: q176.spq
    data: |
      SELECT + col1 * + 98 - col2 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT + col0 IN ( - col1, + col2 * col1 );
  - name: tab0

outputs:
  - name: q176.out
    data: |
      -1
      2048
      7891
